import React, { useState } from "react";

const App=()=>{
    const[name,setName] = useState();
    const change = (event) => {
        setName(event.target.value);
    }


    return(
        <>
            <div>
                <h1>Hello {name} </h1>
                <input type="text" placeholder="Enter your name" onChange = {change}></input>
                <br></br>
                <button>Click me</button>
            </div>
        </>
    )

};

export default App;
